    if (json['items'] != null) {
      _items = [];
      json['items'].forEach((v) {
        _items?.add(Info.fromJson(v));
      });
    }
    _statusCode = json['status_code'];
  }

  List<Info>? _items;
  int? _statusCode;

  HotSearchGameEntity copyWith({
    List<Info>? items,
    int? statusCode,
  }) =>
      HotSearchGameEntity(
        items: items ?? _items,
        statusCode: statusCode ?? _statusCode,
      );

